            ReactHTML.h2 {
                css {
                    textAlign = TextAlign.center
                }
                +"Controls"
            }
            +"The user interface consists of two halves that can be reconfigured by dragging the separating line. The left/bottom side exposes the settings used in the algorithm and allows one to view and modify the current points. In addition, example inputs are provided. When loaded, the settings are set to 'good' values. The right/top side of the screen shows the visualization and the input points. At the top there is a button to run the algorithms and tools for modifying the input points, fitting the drawing to the screen, and downloading the output as an SVG. Note that the drawing can be panned with the right and middle mouse button, and with the left mouse button when no tool is selected. The scroll wheel zooms the visualization."
            ReactHTML.h2 {
                css {
                    textAlign = TextAlign.center
                }
                +"Links"
            }
            +"The source code is accessible on GitHub: "
            ReactHTML.a {
                href = "https://github.com/Yvee1/SimpleSets"
                +"github.com/Yvee1/SimpleSets"
            }
            ReactHTML.div {
                css {
                    position = Position.absolute
                    top = 10.px
                    right = 20.px
                    color = NamedColor.gray
                    cursor = Cursor.pointer
                    fontSize = 30.px
                }
                onClick = {
                    props.closeScreen()
                }
                +"×"
            }
